import React from 'react'; 
import {Link} from 'react-router-dom';

function Footer() {

    const navStyle = {
        color: 'white'
      };

    return (
      <div className='footer'>

        <ul className="nav-links">

        <Link style={ navStyle } to='/'>
          <li> D || A </li>
        </Link>

        <Link style={ navStyle } to='/about'>
          <li> ABOUT </li>
        </Link>

        <Link style={ navStyle } >
          <li> PORTFOLIO </li>
        </Link>

      </ul>
      </div>
    );
  }

  export default Footer;
